func generateTx(c *ethclient.Client, from common.Address, to *common.Address, nonce uint64, data []byte, value *big.Int, chainId *big.Int) (*types.Transaction, error) {
	ctx := context.Background()
	tipCap, err := c.SuggestGasTipCap(ctx)
	if err != nil {
		return nil, err
	}

	latestHeader, err := c.HeaderByNumber(ctx, nil)
	if err != nil {
		return nil, err
	}

	gasFeeCap := new(big.Int).Add(
		tipCap, new(big.Int).Mul(latestHeader.BaseFee, big.NewInt(2)),
	)

	msg := ethereum.CallMsg{
		From:      from,
		To:        to,
		GasTipCap: tipCap,
		GasFeeCap: gasFeeCap,
		Value:     value,
		Data:      data,
	}

	gasLimit, err := c.EstimateGas(ctx, msg)
	if err != nil {
		return nil, err
	}

	tx := types.NewTx(&types.DynamicFeeTx{
		ChainID:   chainId,
		Nonce:     nonce,
		To:        to,
		Value:     big.NewInt(0),
		GasTipCap: tipCap,
		GasFeeCap: gasFeeCap,
		Gas:       gasLimit * 6 / 5,
		Data:      data,
	})

	return tx, nil

}

func generateTxWithGasLimit(c *ethclient.Client, from common.Address, to *common.Address, nonce uint64, data []byte, value *big.Int, chainId *big.Int, gasLimit uint64) (*types.Transaction, error) {
	ctx := context.Background()
	tipCap, err := c.SuggestGasTipCap(ctx)
	if err != nil {
		return nil, err
	}

	latestHeader, err := c.HeaderByNumber(ctx, nil)
	if err != nil {
		return nil, err
	}

	gasFeeCap := new(big.Int).Add(
		tipCap, new(big.Int).Mul(latestHeader.BaseFee, big.NewInt(2)),
	)

	tx := types.NewTx(&types.DynamicFeeTx{
		ChainID:   chainId,
		Nonce:     nonce,
		To:        to,
		Value:     big.NewInt(0),
		GasTipCap: tipCap,
		GasFeeCap: gasFeeCap,
		Gas:       gasLimit,
		Data:      data,
	})

	return tx, nil

}

